    console.log("input value", event.target.value);

    setId(event.target.value);
  }

  const randomId = Math.floor(Math.random() * 826);

  return (
    <div className="bar">
      <input
        onChange={handleChange}
        type="search"
        name="search"
        value={id}
        className="searchInput"
      />
      {/* <button className="searchButton" onClick={() => onSearch(id)}>
        Agregar
      </button> */}
      ;
    </div>
  );
}
